        if lhs.pubkey != rhs.pubkey {
            return false
        }
        if lhs.npub != rhs.npub {
            return false
        }
        if lhs.displayName != rhs.displayName {
            return false
        }
        return true
    }

    public func hash(into hasher: inout Hasher) {
        hasher.combine(pubkey)
        hasher.combine(npub)
        hasher.combine(displayName)
    }
}



