/**
 * Errors that can occur during TENEX operations.
 */
public enum TenexError: Swift.Error {

    
    
    case InvalidNsec(message: String
    )
    case NotLoggedIn
    case Internal(message: String
    )
}


#if swift(>=5.8)
@_documentation(visibility: private)
#endif
public struct FfiConverterTypeTenexError: FfiConverterRustBuffer {
    typealias SwiftType = TenexError

    public static func read(from buf: inout (data: Data, offset: Data.Index)) throws -> TenexError {
        let variant: Int32 = try readInt(&buf)
        switch variant {

        

        
        case 1: return .InvalidNsec(
            message: try FfiConverterString.read(from: &buf)
            )
        case 2: return .NotLoggedIn
        case 3: return .Internal(
            message: try FfiConverterString.read(from: &buf)
            )

         default: throw UniffiInternalError.unexpectedEnumCase
        }
    }

    public static func write(_ value: TenexError, into buf: inout [UInt8]) {
        switch value {

        

        
        
        case let .InvalidNsec(message):
            writeInt(&buf, Int32(1))
            FfiConverterString.write(message, into: &buf)
            
        
        case .NotLoggedIn:
            writeInt(&buf, Int32(2))
        
        
        case let .Internal(message):
            writeInt(&buf, Int32(3))
            FfiConverterString.write(message, into: &buf)
            
        }
    }
}


